INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1001, "お！\nあそこに困ってそうな人発見！", 0, 0, 1, "春咲 ひより", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1002, "大切な人を\n守れるようになりたい…って", 0, 0, 1, "草野 優衣", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "フェンシングを始めてみては？", 0, 0, "少しは磨かれると思いますよ。", 0, 1003, "キミに必要な集中力と感性が", 0, 0, 1, "士条 怜", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "ねぇ、にいちゃん！", 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1004, "今日はなにして遊ぶ？", 0, 0, 1, "穂高 みそぎ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "風宮あかりです", 0, 0, "私といっしょに…\nいかない？", 0, 1006, "ねぇ…", 0, 0, 1, "風宮 あかり", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "出雲宮子なのー", 0, 0, "食べ物の恨みは怖いのー", 0, 1007, "プリンたべたいのー", 0, 0, 1, "出雲 宮子", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "ボクは虹村雪。", 0, 0, "いいよ。\n見られることは運命さ…", 0, 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, 1, "虹村 雪", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "フッ…聞いて後悔するがいい！", 0, 0, "人呼んで「疾風の冥姫」!!", 0, 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, 1, "柊杏奈", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, "ほんまおおきにやわ～♪", 0, 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, 1, "姫宮 真歩", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "衣之咲璃乃です！", 0, 0, "ここで会ったが\n100年目～！", 0, 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, 1, "衣之咲 璃乃", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1012, "ち、超能力って…\n何のことかな～？", 0, 0, 1, "柏崎 初音", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "ちょす！\n美波鈴奈だよ～♪", 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1016, "一応カリスマ読モJKやってまっす！", 0, 0, 1, "美波 鈴奈", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "はいたーい。\n喜屋武香織さー。", 0, 0, "でも、沖縄もとってもいいとこさー", 0, 1017, "東京は遊園地みたいなところさー", 0, 0, 1, "喜屋武 香織", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "支倉伊緒です。", 0, 0, "イオちゃんって呼んでね。", 0, 1018, "先生って呼ばれるのは\nくすぐったいから", 0, 0, 1, "支倉 伊緒", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, "ミミをおいてかないでぇ～", 0, 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, 1, "茜 ミミ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, "ふぇぇぇぇぇん……", 0, 1021, "あの……\nふぇ……", 0, 0, 1, "栗林 くるみ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "風宮よりです。\nあああああ！", 0, 0, "なんてありがとうございます！", 0, 1022, "こんな私に貴重な時間を\n割いていただき、", 0, 0, 1, "風宮 より", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, "私こっち行きたいー\nね、早く早くー", 0, 1023, "おにいちゃんどこいくの？\nえ？", 0, 0, 1, "北条 綾音", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, "これて何か違う…\nあああすみません！", 0, 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, 1, "天野 すずめ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "……クスクス…私は\n…倉石恵理子……", 0, 0, "離しませんわ………\n絶対に…!!", 0, 1027, "あなたは…運命の……\n伴侶……", 0, 0, 1, "倉石 恵理子", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, "…そうでしょ？？", 0, 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, 1, "佐々木 咲恋", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "桜井望だよ！\nよろしくねっ", 0, 0, "あはは、\n私もまだまだだなぁ～", 0, 1029, "ぇっと…\nキミ、私のこと知らないの?!", 0, 0, 1, "桜井 望", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "デケデケデンっ！", 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, 1, "ニノン・ジュベール", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, "おかしいですね……", 0, 1031, "でもって私の隣にいるのが……\nえ、見えない？", 0, 0, 1, "上喜 しのぶ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, 1033, "けんども\nそれには足りないモンが…", 0, 0, 1, "野戸まひる", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, "ちょ\nちょっと一杯飲んできます…！", 0, 1034, "ちょっと緊張しちゃって…", 0, 0, 1, "綾瀬 ゆかり", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "氷川鏡華…です", 0, 0, "これ以上お話しすることは…\nないです！", 0, 1036, "知らない人とは話しちゃいけないので", 0, 0, 1, "氷川 鏡華", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "柏崎…栞です。", 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1038, "……あ、アラーム。", 0, 0, 1, "柏崎 栞", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "ふ、双葉碧です。", 0, 0, "野に咲く花が、\n唯一の話相手です。", 0, 1040, "私、一人も友達がいなくて……", 0, 0, 1, "双葉 碧", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "三角千歌です。", 0, 0, "そう思っています。", 0, 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, 1, "三角 千歌", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "安芸真琴だ。", 0, 0, "う、疑ってすまなかったな…", 0, 1043, "あぁ？\nお前のそいつの仲間か？", 0, 0, 1, "安芸 真琴", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "わらわこそは夜を総べる者！", 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1044, "生けとし生ける全ての者よ！", 0, 0, 1, "イリヤ・オーンスタイン", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "そこで騎士は妖精を乱暴に……", 0, 0, "ｌク、クウカに何かご用ですか!?", 0, 1045, "ぐふふふふ……はっ！", 0, 0, 1, "遠見 空花", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, 1, "宮坂たまき", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "大神美冬よ！", 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1048, "それでは早速クエストに…", 0, 0, 1, "大神 美冬", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "星野静流だよ！", 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1049, "クエストもバトルも\n掃除も洗濯も", 0, 0, 1, "星野静流", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "アタシは玉泉美咲。", 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1050, "見ての通りの\nセクシー美少女で", 0, 0, 1, "玉泉美咲", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.4, "？？？", 0, 0, "？？？？", 0, 1052, "？？？？", 0, 0, 1, "リマ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, "そ、そこまでいうなら\nもらってやる", 0, 1053, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, "モニカ・ヴァイスヴィント", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, "そ、そこまでいうなら\nもらってやる", 0, 1058, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, "ペコリーヌ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, "そ、そこまでいうなら\nもらってやる", 0, 1059, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, "コッコロ", 1);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (2, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, 0, "そ、そこまでいうなら\nもらってやる", 0, 1060, "菓子でつろうなどと\n稚拙な策を……", 0, 0, 1, "キャル", 1);
